/****** Object:  StoredProcedure [dbo].[InsertSingleCARecord]    Script Date: 24/01/2024 13:24:37 ******/
SET ANSI_NULLS ON
GO
SET QUOTED_IDENTIFIER ON
GO
CREATE PROCEDURE [dbo].[InsertSingleCARecord]
@StudentID bigint,
@AcademicSessionID int,
@TermID int,
@SchoolClassID int,
@SubjectID bigint,
@CAMarkObtainable int,
@CAMarkObtained int,
@EntryDate datetime,
@InsertedBy nvarchar(450)
AS
BEGIN
IF EXISTS(Select RecordID FROM ContinuousAssessments WHERE StudentID=@StudentID AND AcademicSessionID=@AcademicSessionID AND TermID=@TermID AND SchoolClassID=@SchoolClassID AND SubjectID=@SubjectID)
     BEGIN
	  DECLARE @RecordID bigint
	  Select @RecordID=RecordID FROM ContinuousAssessments WHERE StudentID=@StudentID AND AcademicSessionID=@AcademicSessionID AND TermID=@TermID AND SchoolClassID=@SchoolClassID AND SubjectID=@SubjectID
		UPDATE       ContinuousAssessments
		SET                StudentID = @StudentID, AcademicSessionID = @AcademicSessionID, TermID = @TermID, SchoolClassID = @SchoolClassID, SubjectID = @SubjectID, CAMarkObtainable = @CAMarkObtainable, 
								 CAMarkObtained = @CAMArkObtained, EntryDate = @EntryDate, InsertedBy = @InsertedBy
		WHERE        (RecordID = @RecordID)
	 END
IF NOT EXISTS(Select RecordID FROM ContinuousAssessments WHERE StudentID=@StudentID AND AcademicSessionID=@AcademicSessionID AND TermID=@TermID AND SchoolClassID=@SchoolClassID AND SubjectID=@SubjectID)
	BEGIN

		INSERT INTO ContinuousAssessments
								 (StudentID, AcademicSessionID, TermID, SchoolClassID, SubjectID, CAMarkObtainable, CAMarkObtained, EntryDate, InsertedBy)
		VALUES        (@StudentID,@AcademicSessionID,@TermID,@SchoolClassID,@SubjectID,@CAMarkObtainable,@CAMarkObtained,@EntryDate,@InsertedBy)
	END
END
GO
